using namespace std;

bool isPrime[300100];
int N;

static const int MAX = 300000;

int next(int i) {
  if (i % 7 == 1) {
    i += 5;
  } else {
    i += 2;
  }
  return i;
}

vector<int> primes;

void initPrime() {
  fill(isPrime, isPrime + 2, false);
  fill(isPrime + 2, isPrime + MAX + 1, true);
  for (int i = 2; i <= MAX; i++) {
    if (i % 7 != 1 && i % 7 != 6) {
      isPrime[i] = false;
    }
  }
  for (int i = 6; i * i <= MAX; i = next(i)) {
    for (int j = i + i; j <= MAX; j += i) {
      isPrime[j] = false;
    }
  }
  for (int i = 0; i < MAX; i++) {
    if (isPrime[i]) {
      primes.push_back(i);
    }
  }
}

int main() {
  initPrime();
  while (true) {
    cin >> N;
    if (N == 1) {
      break;
    }
    set<int> primeSet;
    for (int i = 0; i < primes.size(); i++) {
      if (N % primes[i] == 0) {
        primeSet.insert(primes[i]);
      }
    }
    cout << N << ": ";
    for (set<int>::iterator it = primeSet.begin();
         it != primeSet.end(); it++) {
      cout << *it << " ";
    }
    cout << endl;
  }
}

