        for(auto e: d){
            if((e%7 == 1 || e%7 == 6) && is_prime[e])v.push_back(e);
        }
        cout << n << ":";
        for(auto e: v){
            cout << " " << e;
        }
        cout << endl;
    }

    return 0;
}

