int32_t is_prime(uint32_t n)
{
  if (primes[n] != 0) return primes[n];

  for (uint32_t i = 0; i + 6 < n; i += 7) {
    if (i != 0 && (n % (i + 1) == 0)) {
      return primes[n] = 2;
    }
    if (n % (i + 6) == 0) {
      return primes[n] = 2;
    }
  }
  return primes[n] = 1;
}

