	for(auto it=mon_sat_number.begin(); it!=mon_sat_number.end(); ++it){
		is_mon_sat_prime[*it]=true;
	}
	is_mon_sat_prime[1]=false;
	for(auto it=mon_sat_number.begin(); it!=mon_sat_number.end(); ++it){
		if(it==mon_sat_number.begin()) ++it;
