set<int> monday_saturday_primes(int lim) {
    vector<bool> is_prime(lim+1, true);
    for (int i = 0; i < lim+1; ++i) {
        is_prime[i] = i % 7 == 1 or i % 7 == 6;
    }
    is_prime[1] = false;
    set<int> result;
    for (int i = 1; ; ++i) {
        for (int j : { -1, 1 }) {
            int n = i*7+j;
            if (not (n < lim+1)) goto done;
            if (is_prime[n]) {
                result.insert(n);
                for (int k = n+n; k < lim+1; k += n) {
                    is_prime[k] = false;
                }
            }
        }
    }
done:
    return result;
}

set<int> monday_saturday_prime_factors(int n) {
    assert (n % 7 == 1 or n % 7 == 6);
    set<int> result;
    for (int i = 1; ; ++i) {
        for (int j : { -1, 1 }) {
            int m = 7*i + j;
            if (not (m <= n)) goto done;
            if (n % m == 0) {
                result.insert(m);
            }
        }
    }
done:
    return result;
}

int main() {
    set<int> primes = monday_saturday_primes(300000);
    while (true) {
        int n; cin >> n;
        if (n == 1) break;
        cout << n << ":";
        for (int p : monday_saturday_prime_factors(n)) {
            if (primes.count(p)) {
                cout << " " << p;
            }
        }
        cout << endl;
    }
    return 0;
}

