            break;
        }
        std::deque<int> deq;
        double SqrtNum=sqrt(n);
        for (int i=1;i<=SqrtNum;i++) {
            if (n%i==0) {
                if (i%7==1||i%7==6) {
                    deq.emplace_back(i);
                    if ((n/i)%7==1||(n/i)%7==6) {
                        deq.emplace_back(n/i);
                    }
                }
            }
        }
        std::deque<int> ans;
        for (int i=0;i<deq.size();i++) {
            if (deq[i]!=1) {
                SqrtNum=sqrt(deq[i]);
                std::deque<int> tmp;
                for (int j=1;j<=SqrtNum;j++) {
                    if (deq[i]%j==0) {
                        if (j%7==1||j%7==6) {
                            tmp.emplace_back(deq[i]);
                            if ((deq[i]/j)%7==1||(deq[i]/j)%7==6) {
                                tmp.emplace_back(deq[i]/j);
                            }
                        }
                    }
                }
                if (tmp.size()==2) {
                    ans.emplace_back(deq[i]);
                }
