		}
		printf("%d:", num);
		//int i = 6;
		int next = MON;

		for (int i = 0; i <= num; i += next == SAT ? 5 : 2,next = next == SAT ? MON : SAT){
			if (num%i == 0){
				if (isMonSatPrime(i) == 1){
					printf(" %d", i);
				}
			}

		}

		puts("");
	}
	return 0;
}

