vector<int> prime_factor(int n) {
	const int ori = n;
	vector<int> res;
	for(int i = 0; i < (int)primes.size() && primes[i] <= n; ++i) {
		if(n % primes[i] == 0)
			res.push_back(primes[i]);
	}

	return res;
}

