	vector<int> res;
	vector<bool> prime(MAX, true);

	for(int n = 0; 7 * n + 1 < MAX; ++n) {
		if(n) {
			const int x = 7 * n + 1;
			if(prime[x]) {
				res.push_back(x);
				for(int i = x + x; i < MAX; i += x)
					prime[i] = false;
			}
		}

		if(7 * n + 6 < MAX) {
			const int x = 7 * n + 6;
			if(prime[x]) {
				res.push_back(x);
				for(int i = x + x; i < MAX; i += x)
					prime[i] = false;
			}
		}
	}

	return res;
}

