int isMonSatPrime(int cand){

	if (cand % 7 != 1 && cand % 7 != 6){
		return(0);
	}

	if (cand < 2){
		return(0);
	}

	int i = 6;
	int next = MON;

	while (i > 1){
		if (cand % i == 0){
			break;
		}

		i += next == SAT ? 2 : 5;
		next = next == SAT ? MON : SAT;

	}

	return i == cand ? 1 : 0;
}

