    int p = 0;
    for (int i = 0; i <= n; ++i) is_prime[i] = true;
    is_prime[0] = is_prime[1] = false;
    is_prime[6] = true;
    for (int i = 2; i <= n; ++i) {
        if (is_prime[i] and (i%7==1 or i%7==6)) {
            prime[p++] = i;
            for (int j = 2*i; j <= n; j += i) is_prime[j] = false;
        }
        else {
            is_prime[i] = false;
        }
    }
}

