map<int, int> prime_factor(int n) {
    map<int, int> res;
    for (int i=2;i<n;++i) {
        if (n%i==0 and is_prime[i]) {
            ++res[i];
            //n /= i;
        }
    }
    if (is_prime[n] and n%7 == 1 or n%7 == 6) res[n] = 1;
    //if (n != 1) res[n] = 1;
    return res;
}

