int calced;

int prime[400000];
int count;

void make_prime( int end ) {

	if ( end >= calced ) {
		for ( int i=calced; i<=end; i++ ) {
			if ( i % 7 == 1 || i % 7 == 6 ) {
				bool pass = true;

				int now = (int)sqrt((double)i)+1;

				for ( int j=0; j<count; j++ ) {
					if ( prime[j] > now )
						break;
					if ( i%prime[j] == 0 ) {
						pass = false;
						break;
					}
				}
				if ( pass ) {
					prime[count] = i;
					count++;
				}
			}
		}
	}
	calced = end+1;
}

void view_prime(int end ) {

	cout << end << ':';

	for ( int i=0; i<count ; i++ ) {
		if ( end % prime[i] == 0 ) {
			cout << ' ' << prime[i];
		}
	}
	cout << endl;
}

