std::set<int> divisors(int n) {
  std::set<int> res;
  for (int i = 1; i*i <= n; ++i) {
    if (n % i == 0) {
      res.insert(i);
      res.insert(n/i);
    }
  }
  return res;
}

int main() {
  int M = 300000;
  std::vector<int> sieve(M+1);

  sieve[1] = -2;
  for (int i = 2; i*i <= M; ++i) {
    if (!(i % 7 == 1 || i % 7 == 6)) continue;
    if (sieve[i]) continue;
    for (int j = i*i; j <= M; j += i) {
      sieve[j] = i;
    }
  }

  while (true) {
    int n;
    scanf("%d", &n);
    if (n == 1) break;

    auto d = divisors(n);
    printf("%d:", n);
    for (auto i: d) {
      if (!(i % 7 == 1 || i % 7 == 6)) continue;
      if (sieve[i] == 0) printf(" %d", i);
    }
    puts("");
  }
}

