vector<bool> Mon_Sat_sieve(int x){//range...[0,x]
    vector<bool> flags(x+1,true);
    for(int i=1;7*i+1<=x;i++){
        int sat = 7*i-1,mon=7*i+1;
        if(flags[sat])for(int mult = 2*sat;mult<=x;mult+=sat)flags[mult]=false;
        if(flags[mon])for(int mult = 2*mon;mult<=x;mult+=mon)flags[mult]=false;
    }
    return flags;
}

