using namespace std;

bool is_msn(int n) {
    return n % 7 == 1 || n % 7 == 6;
}

bool is_prime(int n) {
    for (int i = 2; i * i <= n; ++i) {
        if (is_msn(i) && n % i == 0) {
            return false;
        }
    }
    return true;
}

vector<int> solve(int n) {
    vector<int> retval;
    set<int> divs;
    for (int i = 2; i <= n; ++i) {
        if (is_msn(i) && n % i == 0 && is_prime(i)) {
            divs.insert(i);
        }
    }
    for (set<int>::iterator iter = divs.begin(); iter != divs.end(); ++iter) {
        retval.push_back(*iter);
    }
    return retval;
}

