int sieve(int n){
	int p=0;
	for(int i=0; i<=n; i++){
		if(i%7==1 || i%7==6){
			is_prime[i]=true;
		}else{
			is_prime[i]=false;
		}
	}
	is_prime[0]=is_prime[1]=false;
	for(int i=2; i<=n; i++){
		if(is_prime[i]){
