        isNotMSPrime[i*n] = true;
    }
}

int main(int argc, const char * argv[]) {

    for(int i = 2; i < MAXN; i++){
        if(!isNotMSPrime[i] && (i % 7 == 1 || i % 7 == 6)){
            calMSPrime(i);
            MSPrimes.push_back(i);
        }
    }

    while(1){
        int n; cin >> n;
        if(n == 1) break;

        set<int> primes;
        for(int id = 0; id < MSPrimes.size() && n >= MSPrimes[id]; id++){
