using namespace std;
#define INF 100000000
#define NUM 300000
typedef long long ll;

bool prime[300010];

int main(void) {
    for (int i = 0; i <= NUM; i++) prime[i] = true;
    prime[1] = false;
    for (int i = 2; 6 * i <= NUM; i++) {
        prime[6 * i] = false;
    }
    for (int i = 1; i * 7 <= NUM; i++) {
        int j = i * 7 + 1;
        if (prime[j]) {
            for (int k = 2; k * j <= NUM; k++) {
                prime[k * j] = false;
            }
        }
        j = i * 7 + 6;
        if (prime[j]) {
            for (int k = 2; k * j <= NUM; k++) {
                prime[k*j] = false;
            }
        }
    }
    int N;
    while (1) {
        cin >> N;
        if (N == 1) break;
        vector<int> ans;
        for (int i = 1; i * i <= N; i++) {
            if (N % i == 0) {
                int I = N / i;
                if (i % 7 == 1 || i % 7 == 6) {
                    ans.push_back(i);
                }
                if (I != i && (I % 7 == 1 || I % 7 == 6)) {
                    ans.push_back(I);
                }
            }
        }
        sort(ans.begin(), ans.end());
        printf("%d:", N);
        for (int i = 0; i < ans.size(); i++) {
            if (prime[ans[i]]) cout << " " << ans[i];
        }
        cout << endl;
    }
    return 0;
}

