const int N = 300000;
int p[N + 1];

int main(){
	int n;
	fill(p, p + N + 1, 0);
	for(int i = 0;i < N / 7;++i){
		p[7 * i + 1] = p[7 * i + 6] = 1;
	}
	p[1] = 0;
	for(int i = 0;i <= sqrt(N + 1);++i){
		if(p[7 * i + 1]){
			int inc = 7 * i + 1;
			for(int j = 2 * (7 * i + 1);j <= N;j += inc){
				p[j] = 0;
			}
		}
		if(p[7 * i + 6]){
			int inc = 7 * i + 6;
			for(int j = 2 * (7 * i + 6);j <= N;j += inc){
				p[j] = 0;
			}
		}
	}
	while(cin >> n, n != 1){
		int c = 0;
		cout << n << ":";
		for(int i = 6;i <= n / 6;++i){
			if(p[i] && n % i == 0){
				cout << " " << i;
				++c;
			}
		}
		if(!c) cout << " " << n;
		cout << endl;
	}
	return 0;
}

