void solve(int a)
{
	vector<int> answer;
	int b = 1;
	while(b <= a){
		if(b % 7 == 1)
			b += 5;
		else
			b += 2;
		if(a % b == 0){
			unsigned i;
			for(i=0; i<answer.size(); ++i)
				if(b % answer[i] == 0)
					break;
			if(i == answer.size())
				answer.push_back(b);
		}
	}

	cout << a << ':';
	for(unsigned i=0; i<answer.size(); ++i)
		cout << ' ' << answer[i];
	cout << endl;
}

int main()
{
	for(;;){
		int a;
		cin >> a;
		if(a == 1)
			break;

		solve(a);
	}
}

