static int prime[300000 + 1];
static int primeLength = 0;
void setPrime()
{
	prime[primeLength] = 7 * 0 + 6;
	primeLength++;
	for (int i = 1; 7 * i + 6 <= 300000; i++)
	{
		bool flag = false;
		for (int j = 0; j < primeLength; j++)
		{
			if ((i * 7 + 1) % prime[j] == 0)
			{
				flag = true;
				break;
			}
		}
		if(!flag)prime[primeLength++] = i * 7 + 1;
		flag = false;
		for (int j = 0; j < primeLength; j++)
		{
			if ((i * 7 + 6) % prime[j] == 0)
			{
				flag = true;
				break;
			}
		}
		if(!flag)prime[primeLength++] = i * 7 + 6;
	}
}
int main()
{
	setPrime();
	int n;
	while(cin >> n && n != 1)
	{
		int ansList[150000];
		int ansCount = 0;
		int i = 0;
		while (i < primeLength && prime[i] <= n)
		{
			if (n % prime[i] == 0)
			{
				ansList[ansCount++] = prime[i];
			}
			i++;
		}
		cout << n << ":";
		for (int i = 0; i < ansCount; i++)
		{
			cout << " "<< ansList[i];
		}

		cout <<endl;
	}
	return 0;
}

