vector<bool> SievePrimes(long long n) {
  vector<bool> primes(n,true);
  primes[0] = primes[1] = false;

  ll m = 6;
  bool flag = true;
  while (m*m <= n) {
    if (primes[m]) {
      for (ll i = m; i <= n; i += m) {
        if (i == m) continue;
        if (primes[i]) {
          primes[i] = false;
        }
      }
    }
    if (flag) {
      m += 2;
    } else {
      m += 5;
    }

    flag = !flag;
  }

  return primes;
}

