bool isprime(int n)
{
    if(n == 1) return false;
    else if(n == 6) return true;
    else if(n % 6 == 0) return false;
    else {
        for(int i = 1; 7 * i <= n; i++){
            if(n == 7 * i + 1) break;
            else if(n == 7 * i + 6){
                if(n % (7 * i + 1) == 0) return false;
                else return true;
            } else if(n % (7 * i + 1) == 0 || n % (7 * i + 6) == 0) return false;
        }
    }
    return true;
}

