using namespace std;

void set_prime_number(bool* array, int num) {

  fill(array, array + num, false);
  array[1] = false;

  for (int i = 2; i < num; i++) {
    if (i % 7 == 1 || i % 7 == 6) {
      array[i] = true;
    }
  }

  for (int i = 2; i < num; i++) {
    if (!array[i])
      continue; //月曜土曜数以外を省く

    //月曜土曜数の倍数を削除していく
    for (int j = i * 2; j < num; j = j + i) {
      array[j] = false;
    }
  }

}

int main() {
  bool prime_number[300000];
  int num;

  set_prime_number(prime_number, 300000);
  scanf("%d", &num);
  while (num != 1) {
    printf("%d: ", num);
    for (int i = 0; i <= num; i++) {
      if (prime_number[i]) {
        if (num % i == 0) {
          printf("%d ", i);
        }
      }
    }
    printf("\n");
    scanf("%d", &num);
  }

  return 0;
}

