bool prime_table[300005];

void sieve(int n) {
  for (int i = 0; i <= n; i++) { prime_table[i] = false; }
  for (int i = 7; i <= n; i+=7) {
    prime_table[i-1] = true;
    prime_table[i+1] = true;
  }

  for (int i = 7; i <= n; i += 7) {
    if (prime_table[i-1]) {
      for ( int j = 2 * (i-1); j <= n; j += (i-1) ) {
        prime_table[j] = false;
      }
    }
    if (prime_table[i+1]) {
      for ( int j = 2 * (i+1); j <= n; j += (i+1) ) {
        prime_table[j] = false;
      }
    }
  }
}

