const int N_MAX = 300010;

vector<int> primes;
void sieve(){
    vector<bool> is_prime(N_MAX, true);

    int cnt = 1;
    while(true){
        for(int i=-1; i<=2; i+=2){
            int x = cnt*7 + i;
            if(is_prime[x]){
                for(int j=2*x; j<N_MAX; j+=x)
                    is_prime[j] = false;
                primes.push_back(x);
            }
        }
        if(cnt*7 > N_MAX)
            break;
        cnt++;
    }
}

int N;

void solve(){
    cout << N << ":";

    for(auto v: primes) if(N%v == 0)
        cout << " " << v;

    cout << endl;
}

int main(){
    sieve();
    while(cin >> N, N != 1)
        solve();

    return 0;
}

