double dfs(int K, double L, double R, double P, double E, double T) {
  double H = 0.5*(L+R);
  if (K == 0) return (std::abs(T-H) < E)? 1.0:0.0;

  double LH = dfs(K-1, L, H, P, E, T);
  double HR = dfs(K-1, H, R, P, E, T);
  if (H >= T) {
    return P * HR + (1.0-P) * LH;
  } else {
    return P * LH + (1.0-P) * HR;
  }
}

