	vector<char> is_prime(n + 1, false);
	for (int i = 1; 7 * i - 1 <= n; i++)
		is_prime[7 * i - 1] = true;
	for (int i = 1; 7 * i + 1 <= n; i++)
		is_prime[7 * i + 1] = true;

	for (int i = 1; 7 * i - 1 <= n; i++) {
		int a = 7 * i - 1;
		if (is_prime[a]) {
			int b = a + a;
			while (b <= n) {
				is_prime[b] = false;
				b += a;
			}
		}
	}
	for (int i = 1; 7 * i + 1 <= n; i++) {
		int a = 7 * i + 1;
