bool subprime(int n){
	int i = 6;
	bool r;
	while (i < n){//6 8 13 15
		if (n%i == 0){
			return false;
		}
		if (i % 7 == 6){ i += 2; }
		if (i == n){ break; }
		if (n%i == 0){
			return false;
		}
		if (i % 7 == 1){ i += 5; }
	}
	return true;
}

