int main()
{
    for (int i = 2; i <= MAX; i++) {
        isprime[i] = true;
    }
    for (int i = 2; i <= MAX; i++) {
        if (i % 7 == 1 or i % 7 == 6) {
            if (isprime[i]) {
                for (int j = 2; i * j <= MAX; j++) {
                    isprime[i * j] = false;
                }
            }
        } else {
            isprime[i] = false;
        }
    }

    vector<int> prime;
    for (int i = 2; i <= MAX; i++) {
        if (isprime[i]) {
            prime.push_back(i);
        }
    }


    while (true) {
        int n;
        cin >> n;
        if (n == 1) {
            break;
        }
        cout << n << ":";
        for (const int p : prime) {
            if (n % p == 0) {
                cout << " " << p;
            }
        }
        cout << endl;
    }
    return 0;
}

