bool is_msprime(int a) // a is ms number
{
  int j;

  j = 6;
  while (j * j <= a) {
    if (a % j == 0) return false;

    if (j % 7 == 1) {
      j = 7 *(j / 7) + 6;
    }
    else if (j % 7 == 6) j = 7 *(j / 7) + 8;
  }
  return a != 1;
}

