		{
			if (i % 7 == 1 || i % 7 == 6)
			{
				div2.push_back(i);
			}

			if (((n / i) % 7 == 1 || (n / i) % 7 == 6) && i * i != n)
			{
				div2.push_back(n / i);
			}
		}
	}

	sort(div2.begin(), div2.end());

	return div2;
}

