            while(nowId < MSPrimes.size() && nowN >= MSPrimes[nowId]){
                int nowPrime = MSPrimes[nowId];
                bool ok = false;

                while(nowN % nowPrime == 0){
                    ok = true;
                    nowN /= nowPrime;
                }
                if(ok) primes.insert(nowPrime);
                nowId++;
            }

        }

        cout << n << ":";
        for(auto i = primes.begin(); i != primes.end(); i++){
            cout << " " << *i;
        }
        cout << endl;
        primes.clear();
