void initPrime() {
  fill(isPrime, isPrime + 2, false);
  fill(isPrime + 2, isPrime + MAX + 1, true);
  for (int i = 2; i <= MAX; i++) {
    if (i % 7 != 1 && i % 7 != 6) {
      isPrime[i] = false;
    }
  }
  for (int i = 6; i * i <= MAX; i = next(i)) {
    for (int j = i + i; j <= MAX; j += i) {
      isPrime[j] = false;
    }
  }
  for (int i = 0; i < MAX; i++) {
    if (isPrime[i]) {
      primes.push_back(i);
    }
  }
}

