#define MAX_IN 300000

struct node
{
  int val;
  struct node *link;
};

struct node *head;

void init()
{
  head = NULL;
}

int empty()
{
  return head == NULL;
}

void insert_node(int in_val)
{
  struct node *new_node = malloc(sizeof(struct node*)), *next = head, *prev = head;

  new_node->val = in_val;

  if(head == NULL)
    {
      head = new_node;
      new_node->link = NULL;
    }
  else
    {
      while(next != NULL)
	{
	  if(next->val == in_val)
	    {
	      free(new_node);
	      return;
	    }
	  if(next->val > in_val)
	    {
	      if(next == head)
		{
		  new_node->link = head;
		  head = new_node;
		  return ;
		}
	      break;
	    }
	  prev = next;
	  next = next->link;
	}
      prev->link = new_node;
      new_node->link = next;
    }
}

int get()
{
  struct node *get_node = head;
  int get_val = head->val;

  head = head->link;

  free(get_node);

  return get_val;
}

