	if ((num - 1) % 7 == 0)
		t = (num - 1) / 7;
	if ((num + 1) % 7 == 0)
	{
		t = (num + 1) / 7;
		flag2 = 0;
	}

	for (int m = 1; m < t; m++)
	{
		for (int n = m; n < t; n++)
		{
			if (flag2)
			{
				if (t == (7 * m * n + m + n))
				{
					getFactors(7 * m + 1);
					getFactors(7 * n + 1);
					flag = 0;
				}
				else if (t == (7 * m * n - m - n))
				{
					getFactors(7 * m - 1);
					getFactors(7 * n - 1);
					flag = 0;
				}
			}
			else
			{
				if (t == (7 * m * n - m + n))
				{
					getFactors(7 * m + 1);
					getFactors(7 * n - 1);
					flag = 0;
				}
				else if (t == (7 * m * n + m - n))
				{
					getFactors(7 * m - 1);
					getFactors(7 * n + 1);
					flag = 0;
				}
			}
		}
		if (m * m * 7 > t)
			break;
	}

	if (flag)
	{
		int i = 0;
		for (i = 0; currTable[i] != 0; i++)
		{
