	boolean[] checked = new boolean[300000 + 10];
	boolean[] memo = new boolean[300000 + 10];
	boolean isp(int n) {
		if (checked[n]) return memo[n];
		boolean res = true;
		for (int d = 2; d * d <= n; d++) if (d % 7 == 1 || d % 7 == 6) {
			if (n % d == 0) {
				res = false;
				break;
			}
		}
		checked[n] = true;
		memo[n] = res;
		return res;
	}

