		while (true) {
			final int n = sc.nextInt();

			if(n == 1){
				break;
			}

			int num = n;
			boolean first = true;
			StringBuilder pre = new StringBuilder();

			for(int i : list){
				num = n;

				if(num % i == 0){
					pre.append(" " + i);
					if(first){
						first = false;
					}

					num /= i;
					while (num % i == 0) {
						num /= i;
					}

				}
			}

