fn solve() {
    let n = 301000;
    let mut pr = vec![true; n];
    let mut fac = vec![Vec::new(); n];
    for i in 6 .. n {
        if i % 7 != 1 && i % 7 != 6 {
            pr[i] = false;
            continue;
        }
        if !pr[i] { continue; }
        fac[i].push(i);
        for j in 2 .. (n - 1) / i + 1 {
            pr[i * j] = false;
            fac[i * j].push(i);
        }
    }
    for a in fac.iter_mut() {
        a.sort();
    }
    loop {
        let u: usize = get();
        if u == 1 { break; }
        print!("{}:", u);
        for a in &fac[u] {
            print!(" {}", a);
        }
        println!();
    }
}

